0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1849_%D0%B3%D0%BE%D0%B4\" title=\"1849 \u0433\u043e\u0434\">1849<\/a>&#160;\u2014 \u0412 \u0431\u043e\u044e \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0420\u043e\u0441\u0441\u0438\u044f\">\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0438\u043c\u0438<\/a> \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u043e\u0433\u0438\u0431 \u0432\u0435\u043d\u0433\u0435\u0440\u0441\u043a\u0438\u0439 \u043f\u043e\u044d\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D0%BD%D0%B4%D0%BE%D1%80_%D0%9F%D0%B5%D1%82%D1%91%D1%84%D0%B8\" title=\"\u0428\u0430\u043d\u0434\u043e\u0440 \u041f\u0435\u0442\u0451\u0444\u0438\">\u0428\u0430\u043d\u0434\u043e\u0440 \u041f\u0435\u0442\u0435\u0444\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1874_%D0%B3%D0%BE%D0%B4\" title=\"1874 \u0433\u043e\u0434\">1874<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80\" title=\"\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440\">\u0412\u0430\u043d\u043a\u0443\u0432\u0435\u0440<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BD%D0%B0%D0%B4%D0%B0\" title=\"\u041a\u0430\u043d\u0430\u0434\u0430\">\u041a\u0430\u043d\u0430\u0434\u0430<\/a>) \u043f\u0440\u0438\u0431\u044b\u043b\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0433\u0440\u0443\u043f\u043f\u0430 \u0440\u0443\u0441\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%BD%D0%BD%D0%BE%D0%BD%D0%B8%D1%82%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u041c\u0435\u043d\u043d\u043e\u043d\u0438\u0442\u0441\u0442\u0432\u043e\">\u043c\u0435\u043d\u043d\u043e\u043d\u0438\u0442\u043e\u0432<\/a>, \u043e\u0442\u043a\u0430\u0437\u0430\u0432\u0448\u0438\u0445\u0441\u044f \u0441\u043b\u0443\u0436\u0438\u0442\u044c \u0432 \u0430\u0440\u043c\u0438\u0438.<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1905_%D0%B3%D0%BE%D0%B4\" title=\"1905 \u0433\u043e\u0434\">1905<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B3%D0%BE%D1%84\" title=\"\u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444\">\u041f\u0435\u0442\u0435\u0440\u0433\u043e\u0444\u0435<\/a> \u043f\u043e\u0434 \u043f\u0440\u0435\u0434\u0441\u0435\u0434\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9_II\" title=\"\u041d\u0438\u043a\u043e\u043b\u0430\u0439 II\">\u041d\u0438\u043a\u043e\u043b\u0430\u044f II<\/a> \u043d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u0441\u0435\u0440\u0438\u044f \u0441\u043e\u0432\u0435\u0449\u0430\u043d\u0438\u0439 \u043f\u043e \u043f\u043e\u0432\u043e\u0434\u0443 \u043f\u043b\u0430\u043d\u0430 \u0441\u043e\u0437\u0434\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D0%B4%D1%83%D0%BC%D0%B0_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%B8%D0%BC%D0%BF%D0%B5%D1%80%D0%B8%D0%B8\" title=\"\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u0430\u044f \u0434\u0443\u043c\u0430 \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438\">\u0413\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0414\u0443\u043c\u044b \u0420\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u0438\u043c\u043f\u0435\u0440\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1907_%D0%B3%D0%BE%D0%B4\" title=\"1907 \u0433\u043e\u0434\">1907<\/a>&#160;\u2014 \u041d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%83%D0%B1%D0%B0\" title=\"\u041a\u0443\u0431\u0430\">\u041a\u0443\u0431\u0435<\/a> \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D1%83%D1%8D%D0%BB%D1%8C\" title=\"\u0414\u0443\u044d\u043b\u044c\">\u0434\u0443\u044d\u043b\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1910_%D0%B3%D0%BE%D0%B4\" title=\"1910 \u0433\u043e\u0434\">1910<\/a>&#160;\u2014 \u041d\u0430 \u0431\u043e\u0440\u0442\u0443 \u043a\u0430\u043d\u0430\u0434\u0441\u043a\u043e\u0433\u043e \u043b\u0430\u0439\u043d\u0435\u0440\u0430 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u043c\u0438\u0440\u0435 \u043f\u0440\u0435\u0441\u0442\u0443\u043f\u043d\u0438\u043a \u0437\u0430\u0434\u0435\u0440\u0436\u0430\u043d \u0441 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u043f\u043e\u043b\u0438\u0446\u0438\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B0%D0%B4%D0%B8%D0%BE\" title=\"\u0420\u0430\u0434\u0438\u043e\">\u0440\u0430\u0434\u0438\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1919_%D0%B3%D0%BE%D0%B4\" title=\"1919 \u0433\u043e\u0434\">1919<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%B5_%D1%83%D1%87%D1%80%D0%B5%D0%B4%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D0%B5_%D1%81%D0%BE%D0%B1%D1%80%D0%B0%D0%BD%D0%B8%D0%B5\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u043e\u0435 \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435\">\u0413\u0435\u0440\u043c\u0430\u043d\u0441\u043a\u043e\u0435 \u0443\u0447\u0440\u0435\u0434\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u0446\u0438\u043e\u043d\u0430\u043b\u044c\u043d\u043e\u0435 \u0441\u043e\u0431\u0440\u0430\u043d\u0438\u0435<\/a>, \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0432\u0448\u0435\u0435 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\">\u0412\u0435\u0439\u043c\u0430\u0440\u0435<\/a>, \u043f\u0440\u0438\u043d\u044f\u043b\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%BE%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%86%D0%B8%D1%8F\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044f\">\u043d\u043e\u0432\u0443\u044e \u043a\u043e\u043d\u0441\u0442\u0438\u0442\u0443\u0446\u0438\u044e<\/a> \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438. \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u044f \u0441\u0442\u0430\u043b\u0430 \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0439, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442 \u043d\u0430\u0437\u043d\u0430\u0447\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D0%BA%D0%B0%D0%BD%D1%86%D0%BB%D0%B5%D1%80\" title=\"\u0420\u0435\u0439\u0445\u0441\u043a\u0430\u043d\u0446\u043b\u0435\u0440\">\u0440\u0435\u0439\u0445\u0441\u043a\u0430\u043d\u0446\u043b\u0435\u0440\u0430<\/a> \u0438 \u043c\u0438\u043d\u0438\u0441\u0442\u0440\u043e\u0432, \u0431\u044b\u043b \u0432\u0435\u0440\u0445\u043e\u0432\u043d\u044b\u043c \u0433\u043b\u0430\u0432\u043d\u043e\u043a\u043e\u043c\u0430\u043d\u0434\u0443\u044e\u0449\u0438\u043c, \u0438\u043c\u0435\u043b \u043f\u0440\u0430\u0432\u043e \u0440\u043e\u0441\u043f\u0443\u0441\u043a\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D0%B9%D1%85%D1%81%D1%82%D0%B0%D0%B3_(%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0)\" class=\"mw-redirect\" title=\"\u0420\u0435\u0439\u0445\u0441\u0442\u0430\u0433 (\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430)\">\u0440\u0435\u0439\u0445\u0441\u0442\u0430\u0433\u0430<\/a>, \u043d\u0430\u0437\u043d\u0430\u0447\u0435\u043d\u0438\u044f \u043d\u043e\u0432\u044b\u0445 \u0432\u044b\u0431\u043e\u0440\u043e\u0432 \u0438 \u0432\u0432\u0435\u0434\u0435\u043d\u0438\u044f \u0447\u0440\u0435\u0437\u0432\u044b\u0447\u0430\u0439\u043d\u043e\u0433\u043e \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u044f. \u041f\u0435\u0440\u0432\u044b\u043c \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u043e\u043c \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB-%D0%B4%D0%B5%D0%BC%D0%BE%D0%BA%D1%80%D0%B0%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0421\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u0441\u043e\u0446\u0438\u0430\u043b-\u0434\u0435\u043c\u043e\u043a\u0440\u0430\u0442<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B1%D0%B5%D1%80%D1%82,_%D0%A4%D1%80%D0%B8%D0%B4%D1%80%D0%B8%D1%85_(%D0%BF%D0%BE%D0%BB%D0%B8%D1%82%D0%B8%D0%BA)\" title=\"\u042d\u0431\u0435\u0440\u0442, \u0424\u0440\u0438\u0434\u0440\u0438\u0445 (\u043f\u043e\u043b\u0438\u0442\u0438\u043a)\">\u0424\u0440\u0438\u0434\u0440\u0438\u0445 \u042d\u0431\u0435\u0440\u0442<\/a>. \u0421\u0432\u043e\u0451 \u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043e\u0432\u0430\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%B9%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0412\u0435\u0439\u043c\u0430\u0440\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a> \u043f\u0440\u0435\u043a\u0440\u0430\u0442\u0438\u043b\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933 \u0433\u043e\u0434\u0443<\/a> \u0441 \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u0435\u043c \u043d\u0430\u0446\u0438\u0441\u0442\u0441\u043a\u043e\u0439 \u0434\u0438\u043a\u0442\u0430\u0442\u0443\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1920_%D0%B3%D0%BE%D0%B4\" title=\"1920 \u0433\u043e\u0434\">1920<\/a>&#160;\u2014 \u041f\u0440\u0438\u043d\u044f\u0442\u0430 \u00ab\u0414\u0435\u043a\u043b\u0430\u0440\u0430\u0446\u0438\u044f \u043e \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0438 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D1%83%D1%81%D1%81%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u0438\u044f\">\u0411\u0435\u043b\u043e\u0440\u0443\u0441\u0441\u043a\u043e\u0439 \u0421\u0421\u0420<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1924_%D0%B3%D0%BE%D0%B4\" title=\"1924 \u0433\u043e\u0434\">1924<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0441\u043a\u043e\u0435<\/a> \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%8F%D0%B7%D1%8B%D0%BA\" title=\"\u0423\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a\">\u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u0438\u0439 \u044f\u0437\u044b\u043a<\/a> \u0432 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u0443\u0447\u0440\u0435\u0436\u0434\u0435\u043d\u0438\u044f\u0445 \u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0413\u0430\u043b\u0438\u0446\u0438\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1925_%D0%B3%D0%BE%D0%B4\" title=\"1925 \u0433\u043e\u0434\">1925<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B0%D0%B1%D0%B0%D1%81%D1%82%D0%BE%D0%B2%D0%BA%D0%B0\" title=\"\u0417\u0430\u0431\u0430\u0441\u0442\u043e\u0432\u043a\u0430\">\u0417\u0430\u0431\u0430\u0441\u0442\u043e\u0432\u043a\u0430<\/a> \u0430\u043d\u0433\u043b\u0438\u0439\u0441\u043a\u0438\u0445 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D0%B0%D1%85%D1%82%D1%91%D1%80\" title=\"\u0428\u0430\u0445\u0442\u0451\u0440\">\u0448\u0430\u0445\u0442\u0451\u0440\u043e\u0432<\/a> \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0430\u0441\u044c \u0438\u0445 \u043f\u043e\u043b\u043d\u043e\u0439 \u043f\u043e\u0431\u0435\u0434\u043e\u0439 (\u00ab\u041a\u0440\u0430\u0441\u043d\u0430\u044f \u043f\u044f\u0442\u043d\u0438\u0446\u0430\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u0412\u043f\u0435\u0440\u0432\u044b\u0435 \u043d\u0430 \u0437\u0430\u0441\u0442\u0430\u0432\u043a\u0435 \u043a\u0438\u043d\u043e\u0441\u0442\u0443\u0434\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Metro-Goldwyn-Mayer\" title=\"Metro-Goldwyn-Mayer\">Metro-Goldwyn-Mayer<\/a>\u00bb \u043f\u043e\u044f\u0432\u0438\u043b\u0441\u044f \u0440\u044b\u0447\u0430\u0449\u0438\u0439 \u043b\u0435\u0432. \u042d\u0442\u043e \u0431\u044b\u043b \u043f\u0435\u0440\u0432\u044b\u0439 \u0437\u0432\u0443\u043a\u043e\u0432\u043e\u0439 \u0444\u0438\u043b\u044c\u043c \u0441\u0442\u0443\u0434\u0438\u0438 \u00ab\u0411\u0435\u043b\u044b\u0435 \u0442\u0435\u043d\u0438 \u044e\u0436\u043d\u044b\u0445 \u043c\u043e\u0440\u0435\u0439\u00bb. \u0417\u0430\u0431\u0430\u0432\u043d\u043e, \u0447\u0442\u043e \u043b\u044c\u0432\u0438\u043d\u044b\u0439 \u0440\u044b\u043a \u0431\u044b\u043b \u0441\u0430\u043c\u044b\u043c \u0434\u043b\u0438\u043d\u043d\u044b\u043c \u0437\u0432\u0443\u043a\u043e\u043c \u0432 \u0444\u0438\u043b\u044c\u043c\u0435, \u0442\u0430\u043a \u043a\u0430\u043a \u0432 \u043d\u0451\u043c \u043f\u0440\u043e\u0438\u0437\u043d\u0435\u0441\u043b\u0438 \u043b\u0438\u0448\u044c \u043e\u0434\u043d\u043e \u0441\u043b\u043e\u0432\u043e&#160;\u2014 \u00ab\u041f\u0440\u0438\u0432\u0435\u0442!\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a>&#160;\u2014 \u0412 \u0445\u043e\u0434\u0435 \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0439 \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BC%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%B0%D1%82_%D0%B2%D0%BD%D1%83%D1%82%D1%80%D0%B5%D0%BD%D0%BD%D0%B8%D1%85_%D0%B4%D0%B5%D0%BB_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u041d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 \u043a\u043e\u043c\u0438\u0441\u0441\u0430\u0440\u0438\u0430\u0442 \u0432\u043d\u0443\u0442\u0440\u0435\u043d\u043d\u0438\u0445 \u0434\u0435\u043b \u0421\u0421\u0421\u0420\">\u041d\u041a\u0412\u0414<\/a> \u0432 \u043e\u0434\u0438\u043d \u0434\u0435\u043d\u044c \u0430\u0440\u0435\u0441\u0442\u043e\u0432\u0430\u043d\u044b \u0442\u044b\u0441\u044f\u0447\u0438 \u0436\u0438\u0442\u0435\u043b\u0435\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%87%D0%BD%D1%8F\" title=\"\u0427\u0435\u0447\u043d\u044f\">\u0427\u0435\u0447\u043d\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1941_%D0%B3%D0%BE%D0%B4\" title=\"1941 \u0433\u043e\u0434\">1941<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B5%D1%80%D0%B8%D0%BD%D0%B3,_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD_%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B5%D0%BB%D1%8C%D0%BC\" class=\"mw-redirect\" title=\"\