42\u0441\u043a\u043e-\u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0414\u043e\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0441\u043e\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0438 \u0441\u0442\u0440\u0430\u0442\u0435\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0432\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0439 (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%9D%D0%92-I\" title=\"\u0421\u041d\u0412-I\">\u0421\u041d\u0412-1<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1992_%D0%B3%D0%BE%D0%B4\" title=\"1992 \u0433\u043e\u0434\">1992<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_A310_%D0%BF%D0%BE%D0%B4_%D0%9A%D0%B0%D1%82%D0%BC%D0%B0%D0%BD%D0%B4%D1%83\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 A310 \u043f\u043e\u0434 \u041a\u0430\u0442\u043c\u0430\u043d\u0434\u0443\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 A310 \u043f\u043e\u0434 \u041a\u0430\u0442\u043c\u0430\u043d\u0434\u0443<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u0430\u044f \u043a\u0440\u0443\u043f\u043d\u0430\u044f \u0430\u0432\u0438\u0430\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BF%D0%B0%D0%BB\" title=\"\u041d\u0435\u043f\u0430\u043b\">\u041d\u0435\u043f\u0430\u043b\u0435<\/a> (113 \u043f\u043e\u0433\u0438\u0431\u0448\u0438\u0445).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1996_%D0%B3%D0%BE%D0%B4\" title=\"1996 \u0433\u043e\u0434\">1996<\/a>&#160;\u2014 \u0424\u0435\u0434\u0435\u0440\u0430\u043b\u044c\u043d\u044b\u0439 \u0441\u0443\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0430<\/a> \u043e\u0442\u043c\u0435\u043d\u0438\u043b \u0437\u0430\u043a\u043e\u043d\u043e\u0434\u0430\u0442\u0435\u043b\u044c\u043d\u044b\u0439 \u0430\u043a\u0442, \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0438\u0432\u0430\u044e\u0449\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B2%D0%BE%D0%B1%D0%BE%D0%B4%D0%B0_%D1%81%D0%BB%D0%BE%D0%B2%D0%B0\" title=\"\u0421\u0432\u043e\u0431\u043e\u0434\u0430 \u0441\u043b\u043e\u0432\u0430\">\u0441\u0432\u043e\u0431\u043e\u0434\u0443 \u0441\u043b\u043e\u0432\u0430<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B5%D1%82\" title=\"\u0418\u043d\u0442\u0435\u0440\u043d\u0435\u0442\">\u0418\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0435<\/a>.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002<\/a>&#160;\u2014 \u041a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/IBM\" title=\"IBM\">IBM<\/a>\u00bb \u0438 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/PricewaterhouseCoopers\" title=\"PricewaterhouseCoopers\">PricewaterhouseCoopers<\/a>\u00bb \u043e\u0431\u044a\u044f\u0432\u0438\u043b\u0438 \u043e \u0434\u043e\u0441\u0442\u0438\u0433\u043d\u0443\u0442\u043e\u043c \u0441\u043e\u0433\u043b\u0430\u0448\u0435\u043d\u0438\u0438 \u043f\u043e \u043f\u0435\u0440\u0435\u0445\u043e\u0434\u0443 \u00abPwC Consulting\u00bb&#160;\u2014 \u0434\u043e\u0447\u0435\u0440\u043d\u0435\u0439 \u0444\u0438\u0440\u043c\u044b \u00abPwC\u00bb, \u0441\u043f\u0435\u0446\u0438\u0430\u043b\u0438\u0437\u0438\u0440\u0443\u044e\u0449\u0435\u0439\u0441\u044f \u043d\u0430 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u0438 \u043a\u043e\u043d\u0441\u0430\u043b\u0442\u0438\u043d\u0433\u043e\u0432\u044b\u0445 \u0443\u0441\u043b\u0443\u0433 \u0438 \u0441\u0435\u0440\u0432\u0438\u0441\u043e\u0432, \u0432 \u0441\u043e\u0431\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0441\u0442\u044c \u00abIBM\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005_%D0%B3%D0%BE%D0%B4\" title=\"2005 \u0433\u043e\u0434\">2005<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D0%BD%D0%BE%D0%B1%D0%BE%D1%80%D0%BE%D0%BD%D1%8B_%D0%A0%D0%A4\" class=\"mw-redirect\" title=\"\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424\">\u041c\u0438\u043d\u043e\u0431\u043e\u0440\u043e\u043d\u044b \u0420\u0424<\/a> \u043b\u0438\u0448\u0438\u043b \u0430\u043a\u043a\u0440\u0435\u0434\u0438\u0442\u0430\u0446\u0438\u0438 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u0438\u0439 \u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/American_Broadcasting_Company\" title=\"American Broadcasting Company\">\u042d\u0439-\u0411\u0438-\u0421\u0438<\/a>\u00bb, \u043f\u043e\u043a\u0430\u0437\u0430\u0432\u0448\u0438\u0439 \u0432 \u0441\u0432\u043e\u0451\u043c \u044d\u0444\u0438\u0440\u0435 \u0438\u043d\u0442\u0435\u0440\u0432\u044c\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D1%81%D0%B0%D0%B5%D0%B2,_%D0%A8%D0%B0%D0%BC%D0%B8%D0%BB%D1%8C_%D0%A1%D0%B0%D0%BB%D0%BC%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0430\u0441\u0430\u0435\u0432, \u0428\u0430\u043c\u0438\u043b\u044c \u0421\u0430\u043b\u043c\u0430\u043d\u043e\u0432\u0438\u0447\">\u0428\u0430\u043c\u0438\u043b\u044f \u0411\u0430\u0441\u0430\u0435\u0432\u0430<\/a>. \u041e\u0431 \u044d\u0442\u043e\u043c \u0437\u0430\u044f\u0432\u0438\u043b \u043c\u0438\u043d\u0438\u0441\u0442\u0440 \u043e\u0431\u043e\u0440\u043e\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0418\u0432\u0430\u043d\u043e\u0432, \u0421\u0435\u0440\u0433\u0435\u0439 \u0411\u043e\u0440\u0438\u0441\u043e\u0432\u0438\u0447\">\u0421\u0435\u0440\u0433\u0435\u0439 \u0418\u0432\u0430\u043d\u043e\u0432<\/a> \u0436\u0443\u0440\u043d\u04